import { Text, View, Image,StyleSheet } from "react-native";


const Navbar = () => {
  return (
    <View style={styles.navbarMain}>
      <Image source={require("../../assets/images/home.png")} />
    </View>
  );
};


const styles = StyleSheet.create({
    navbarMain:{
        position:'absolute',
        alignItems:'center',
        bottom:20
    },
    navbarContainer:{
      
    }
})

export default Navbar;
